package loopsDemo;

public class Whileloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int count = 50;
		while(count<60) {
			System.out.println(count);
			++count;
		}
		int id=34;
		do {
			System.out.println("Id: "+id);
			id++;
		}while(id<=40);
		

	}

}
